(71863, 'E74FEAC6-C21A-43DD-8FB7-B18BA115DFD6', 'Thank you. I️ work really really hard to manage so many fast flowing logistics of our family. And I️ would really appreciate if you could take the time to read what I️ write. I️ know you hear me, but I️ needed to say that again. ', 'Nitzan', 'David', '2023-09-11T16:34:47.448309'),
