(71865, 'B39386A9-ADCA-4F7B-9860-4E1954DF895F', 'That may be. I want to be there because I don’t know if.when I’ll get to spend time with my dad outside of some assisted living or hospice facility. My preference would be for me to spend an extra night and hang out and watch the game with my dad…I don’t give a crap about the game…but I’m feeling pretty sad about his deterioration…just noticing it is impacting me. ', 'David', 'Nitzan', '2023-09-11T17:13:21.756095'),
