(71878, '283EFC20-064E-4C02-97EA-B3DDF272BAE0', 'Sorry love. I️ know I️ was being grumpy last night. I️ feel like our balance on parenting is a bit off balance right now and I️ know it’s not because you want it to be that way…it just is. So I️ have to suck it up. I️ love love being with orli and really enjoy our solo time. I️ just don’t love not having enough time to exercise and sometimes I️ need breaks. ', 'Nitzan', 'David', '2023-09-12T08:13:00.746937'),
