(71882, '18CAB098-708F-41ED-B49D-A5581A59A504', 'On a logistics note - orli has gb3 today. She isn’t wearing an outfit that she can do gymnastics in. I️ left a leotard on the banister. Please take that with you when you pick her up. If you can bring her something to eat in the car, she will appreciate that. She was super super hungry last week when I️ picked her up.', 'Nitzan', 'David', '2023-09-12T08:39:30.391212'),
