(71887, '0449068A-D823-4361-8D8A-693390122C5C', 'The balance has been off the last few weeks and I appreciate you covering. I’m really happy to be home the next few weeks and hope this/next week will restore the balance a bit.  I think both of us stretched the limit this summer with travel and our respective multi day solo commitments', 'David', 'Nitzan', '2023-09-12T12:35:02.271871'),
(71888, '19A7C197-91BF-46FA-AE01-EF1E9D81D216', 'Well….I can start with words. I know not sufficient but a start. I am in awe of and very much appreciate all of the planning you have been doing….from back to school, our multiple travel adventures, covering for this last weekend, setting up for the high holidays and then taking on a Girl Scout troop. It’s kinda insane. And I know takes a ton of time and effort … and given that this not my strength …I value your superpower that much more. I’ll step up in the ways I can…will prioritize getting the bathroom project moving, high holidays cooking, fixing the cars (again) and building the sukkah, for example (oh and taking out Kiki during the day….we just went on a long walk). I also want to send you more positive feedback on how beautiful you looked yesterday in your green dress. Not a single day passes without sparkle moments when I see you….not just your physical appearance…but your warmth and energy and curiosity and kindness. The whole package. It saddens me a bit to see you struggle with loving your body…having an adversarial relationship on some levels. One of things I loved about my exploration last night was witnessing and participating with people to find new ways to raise feelings of pleasure and connectedness….and whether they were physically “attractive” played such a small role in the experience. I know it’s not your primary “love language” but I’d love to see you find more pleasure from your body…and not just asking of it to deliver more splat points (although I had 22this morning!)', 'David', 'Nitzan', '2023-09-12T13:06:52.298038'),
(71889, '1B966317-5EC6-4DA9-B9C5-015CB38D0412', 'Thank you so so much for this love. I️ totally need it. I️’m dragging at this conf and feeling really sad on the inside of my body. I️ can’t pinpoint why exactly but man does this conference not feel like me or where my people are. ', 'Nitzan', 'David', '2023-09-12T13:17:00.442011'),
